import React from "react";
import { Route, Switch } from "react-router-dom";
import "./App.css";
import Welcome from "./Components/Welcome";
import Navigation from "./Components/Navigation";

function App() {
  return (
    <div className="App">
      <Navigation />
      <Switch>
        <Route exact path="/" component={Welcome} />
      </Switch>
    </div>
  );
}

export default App;
